function memoize(a,b){return b=b||{},function(c){return b[c]||(b[c]=a(c))}}function compose(a,b){return function(){return a(b.apply(this,arguments))}}function pipe(a){return function(b){return a.reduce(function(a,b){return b(a)},b)}}function once(a){var b;return function(){return a&&(b=a.apply(this,arguments),a=null),b}}